import { Button, Modal } from "react-bootstrap";

export function PopupDelete(props) {
  return (
    <Modal
      centered
      show={props?.show}
      onHide={() => {
        props?.onHide();
      }}
    >
      <Modal.Header className="bg-blue2">
        <Modal.Title className="text-white" style={{ fontSize: "22px" }}>
          {props?.title}
        </Modal.Title>
      </Modal.Header>
      <Modal.Body className="d-flex" style={{ justifyContent: "center" }}>
        <img
          width={350}
          height={175}
          className="mb-2"
          src="/media/assets/deleteTrash.gif"
          alt=""
        />
      </Modal.Body>
      <Modal.Footer>
        <div className="d-flex justify-content-center">
          <Button
            className="btn btn-secondary"
            style={{ marginRight: 10 }}
            onClick={() => {
              props?.onHide();
            }}
          >
            QUAY LẠI
          </Button>
          <Button
            className="btn btn-primary"
            onClick={() => {
              props?.onDetele();
              props?.onHide();
            }}
          >
            Đồng ý
          </Button>
        </div>
      </Modal.Footer>
    </Modal>
  );
}
